        background: 'rgba(28,38,76,1)',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        boxSizing: 'border-box',
      }}
    >
      {/* Frame7 content goes here */}
      <Frame7a />
    </div>
  );
};

